import React from "react";
import "./Landing.css";
import { Link } from "react-router-dom";
import handshake from "../../Images/handshake.webp";
import handshakejob from "../../Images/handshake-job.jpg";

function Landing() {
  // const SignInHandler = () => {
  //   console.log("worked");
  // };
  return (
    <div>
      <div class="container">
        <span className="Studentsclick">Students</span>
        <span> </span>
        <span className="Employersclick"> Employers</span>
        <Link
          className="Signinclick"
          className="navbar-btn"
          to="./../Signin/Pages/Signin"
        >
          SignIn
        </Link>
      </div>
      <div className="row">
        <div className="column">
          <div className="hs">
            <img src={handshake} alt="HandShake" height="200" width="200"></img>
          </div>
        </div>
        <div className="column">
          <div className="hsjob">
            <img src={handshakejob} alt="HandShake" />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Landing;
